['The dynamical behaviour of the anisotropic order parameter  $m$ [see Eq.~\eqref{eq:def-m} in the Letter] following a quench to the critical point is well described by
the Gaussian theory for all the three lattice gas models studied, $i.e.,$ driven lattice gas with either constant (IDLG) or random (RDLG) infinite drive and equilibrium lattice gas (LG). In other words, in the short-time regime, $m \sim t^{1/2}$ [see Eq. \eqref{eq:mt}] and the Binder cumulant $g$ of the lowest transverse mode [defined in Eq. \eqref{eq:binder}] is zero in this regime. The alternative order parameter $O,$ however, distinguishes between the driven (IDLG, RDLG) and the equilibrium (LG) lattice gases.', 'On the other hand,  Eq.~\eqref{eq:alpha} predicts $\alpha = 1/10$ upon substituting the values of the critical exponents corresponding to the Ising  universality class (LG). This is consistent with the numerical simulation results presented in the main text, see Fig. \ref{fig:ising}(b) therein.

\begin{figure}[th]
\vspace*{0.2 cm}
 \centering
 \includegraphics[width=10 cm]{./compare_binder.pdf}

\caption{Comparison between the temporal evolution of the Binder cumulants $g$ corresponding to the $12^{th}$ transverse mode, $i.e.,$ with $n_\perp =12,$ in the LG (lowest curve), IDLG and RDLG (two upper curves) on a $32 \times 32$ lattice. \label{fig:b}}
 \label{fig:binder}
\end{figure}', 'Accordingly, the different dynamical behaviour of $O$, which involves a sum over all modes, can be attributed to the non-Gaussian nature of the higher modes in the LG. 
Such a departure is not entirely surprising. In fact, for higher modes, mesoscopic descriptions such as the ones in Eqs. \eqref{eq:L-DLG} or \eqref{eq:g_evol} are not expected to hold, while the anisotropy at the microscopic level could be the mechanism leading to the Gaussianity of higher modes in the driven models.', '\section*{Dynamical Behaviour of $O$ in Lattice Gases}', 'We already remarked that, in the LG, this scaling form is not compatible with the prediction $O \sim t^{1/8}  L_{\parallel}^{-1/2}$ of the Gaussian theory.  However, following Ref. \cite{AS2002}, it can be argued that, at short times, the only dependence of $O$ on the system size $L_{\parallel}$ is of the form $O \sim L_\parallel^{-1/2}$ which is very well confirmed by numerical simulations. Accordingly,  the generic behaviour of $O$ can be assumed to be
\begin{eqnarray}
O \sim t^{\alpha} L_\parallel^{-1/2}, \label{eq:O}
\end{eqnarray}']

['A first attempt to approximate the LMS filter from a probabilistic perspective was presented in \cite{park2014probabilistic}, focusing on a kernel-based implementation. The algorithm of \cite{park2014probabilistic} makes use of a Maximum a Posteriori (MAP) estimate as an approximation for the predictive step. However, this approximation does not preserve the estimate of the uncertainty in each step, therefore degrading the performance of the algorithm.', 'The proposed approach consists in approximating the posterior distribution $p({\bf w}_k|y_{1:k})$, in general a multivariate Gaussian distribution with a full covariance matrix, by an isotropic spherical Gaussian distribution 

\begin{equation}
\label{eq:aprox_post}
\hat{p}({\bf w}_{k}|y_{1:k})=\mathcal{N}({\bf w}_{k};{\bf \hat{\boldsymbol\mu}}_{k}, \hat{\sigma}_{k}^2 {\bf I} ).
\end{equation}

In order to estimate the mean and covariance of the approximate distribution $\hat{p}({\bf w}_{k}|y_{1:k})$, we propose to select those that minimize the Kullback-Leibler divergence with respect to the original distribution, i.e.,', 'The probabilistic perspective we adopt throughout this work presents two main advantages. Firstly, a novel LMS algorithm with adaptable step size emerges naturally with this approach, making it suitable for both stationary and non-stationary environments. The proposed algorithm has less free parameters than previous LMS algorithms with variable step size \cite{kwong1992variable,aboulnasr1997robust,shin2004variable}, and its parameters are easier to be tuned w.r.t. these algorithms and standard LMS. Secondly, the use of a probabilistic model provides us with an estimate of the error variance, which is useful in many applications.', '\begin{itemize}
\item If, instead of using an isotropic Gaussian distribution in the approximation, we used a Gaussian with diagonal covariance matrix, we would obtain a similar algorithm with different step sizes and measures of uncertainty, for each component of ${\bf w}_k$. Although this model can be more descriptive, it needs more parameters to be tuned, and the parallelism with LMS vanishes.
\item Similarly, if we substitute the transition model of \eqref{eq:trans_eq} by an Ornstein-Uhlenbeck process,', 'this steady-state MSD of the estimate of the MISO channel with different methods. As can be seen, the best tracking performance is obtained by standard LMS and the proposed method.']

